export let AboutPage = (props) => {
    return (
        <div className="mx-auto pt-24 h-screen from-blue-800 to-purple-700 bg-gradient-to-r">
            <div className="bg-white xs:w-full md:w-3/4 py-10 mx-auto rounded-lg">
                <h1 className="text-7xl font-bold text-purple-700 text-center">About Me</h1>
                <div className="border-4 border-blue-500 mt-4 mx-5 p-2 rounded-md text-xk">
                    <p>Started programming when I was in 7th grade. It all started when I wanted to make my own mods for my favorite game at the time, Minecraft. Ever since then, its just been an expontential curve of always wanting to learn more. It was then Java, Python and even Lua by the time I had reached Highschool. Since then, I have been focusing on more complex things that intrest me such as game devlopment, smart home technology, and frontend and backend web devlopment. I hope after my current semester, when I got done studying computer secuirty and networking, I hope to move on to even more complex things such as machine learning algorithms!</p>
                </div>
            </div>
        </div>
    )
}
